def fun(qs, arr, s, i, n):
	#print arr,s,i
	if (i==n):
		if s!='':
			arr.update([s])
		return len(set(arr))>=4
	if (s not in arr and s!=''):
		b = set(arr)
		b.update([s])
		return fun(qs, b, '', i, n) or (fun(qs, arr, s+qs[i], i+1, n))
	return (fun(qs, arr, s+qs[i], i+1, n))


